import {BrowserRouter as Router ,Route} from "react-router-dom";
import Jion from "./component/Jion/Jion.js";
import './App.css';


function App() {
  return (
    <div className="App">
     <Router>
      <Routes>
      <Route exact path="/" element={Jion} />

      <Route path="/chat"/>
      </Routes>
     </Router>

    </div>
  );
}

export default App;
